import React from 'react'

const Footer = () => {
    return (
        <footer className="footer mt-auto py-3 bg-secondary border-top border-info">
            <div className="container text-center">
                <span className="text-light">Copyright &copy;</span>
            </div>
        </footer>
    )
}

export default Footer;
